
public class multiDArray {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a[][]={{3,4,5},{4,8,1},{7,4,9}};
		for(int i=0;i<a.length;i++)
		{
			for(int j=0;j<a.length;j++)
			{
				System.out.print(a[i][j]+ " ");
			}
		System.out.println();
		
	}

}
}